Joy cometh in the morning. I wanted to share these photos of mercy and grace. Not long ago, this little blessing wasn't expected to live beyond the day he was born into this world, Dr's had assigned his place, but God said "watch me". 

@rongriswell and @curlsofpoetry , thank you for being the path your little one needed, thank you for continuing to fight. And to my little soon to be hiking buddy, get ready, we have some miles to cover.

#JoyAndBlessings.
